import React, { useState, useEffect } from 'react'


function App() {

  const [data, setData] = useState([{}]);
  let members = [];

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("/members");
      const jsonData = await response.json();
      setData(jsonData.members);
    }

    getData();
  }, [])

  members = data.map((item, i) => {
    <li key={i}>{item}</li>
  });

  return (
    <div >
      <span>My new app</span>
      <br></br>
      {members ? <span>loading...</span> : <ul>members</ul>}
      {console.log(data)}
    </div>
  );
}

export default App;
